import logo from './logo.svg';
import './App.css';


function App() {

  return (
    <div className="App">
  <form>
      <label for="name">First name:</label><br></br>
      <input type="text" id="name" name="fname"/>
      <label for="lname">Last name:</label><br></br>
      <input type="text" id="lname" name="lname"/>
    </form>
    </div>
  );
}

export default App;
